import React from "react";
import classes from "./Cell.module.css";
import { TETROMINOS } from "../../tetrominos";

const Cell = (props) => (
  <div
    className={classes.Cell}
    type={"L"}
    style={{ backgroundColor: `${TETROMINOS["L"].color}`, border: "1px solid" }}
  >
    cell
  </div>
);

export default Cell;
